import React, { useEffect } from "react";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import geojsonFeature from "./drawn_shape.geojson"; // geojson 파일 경로

const GeoJSONMap = () => {
  useEffect(() => {
    const map = L.map("map").setView([10.7298, 106.69451], 20);

    L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
      attribution: "© OpenStreetMap contributors",
    }).addTo(map);

    // geojsonFeature 안에 있는 features 배열을 가져와 지도에 추가합니다.
    if (geojsonFeature && geojsonFeature.features) {
      L.geoJSON(geojsonFeature.features).addTo(map);
    }

    return () => {
      map.remove();
    };
  }, []);

  return (
    <div id="map" style={{ height: "500px" }}>
      {/* 지도를 렌더링할 div 요소 */}
    </div>
  );
};

export default GeoJSONMap;
